import {
  LoginBtn,
  Logo,
  StyledLogin,
} from '../../components/styles/Login.styled';

const Login = () => {
  return (
    <StyledLogin>
      <div>
        <Logo
          src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/2560px-Netflix_2015_logo.svg.png"
          alt="home-logo"
        />
        <LoginBtn>Sign In</LoginBtn>
      </div>
    </StyledLogin>
  );
};

export default Login;
